import { ContextSocketProvider } from "./context/context-socketio";
import ComponentLayer from "./components/data";

function App() {
  return (
    <ContextSocketProvider>
      <div className='"App"'>
        <h1>Hola</h1>

        <ComponentLayer />
      </div>
    </ContextSocketProvider>
  );
}

export default App;
